import { Grid, Typography } from '@mui/material'
import { CcTextField } from './Stocks' 
import React from 'react'

const Invoice = () => {
  return (
    <div>
      {/* Whole Container */}
        <Grid container spacing={2}>

          <Grid item md={10} >
            <Grid container padding={2} style={{
              backgroundColor: 'white'
            }}>

              <CcTextField variant='standard' fullWidth placeholder='Searchbar'/>
            </Grid>
            

          </Grid>
          <Grid item md={12}>
            
          </Grid>

        </Grid>
    </div>
  )
}

export default Invoice
